import React from "react";
import { Container, Row } from "react-bootstrap";

const Home = () => {
  return (
    <div className="custom_bg">
      <Container fluid>
        <Row className="d-flex align-items-center justify-content-start">
        </Row>
      </Container>
    </div>
  );
};

export default Home;
